import styled from 'styled-components'

const ToggleBar = styled.div`
  background-color: white;
  display: flex;
  flex-direction: row;
`;

const ToggleItem = styled.p`
  border-bottom: ${props => props.selected ? '2px solid #00e0c2' : 'unset'};
  color: ${props => props.selected ? '#00e0c2' : '#013d40'};
  cursor: pointer;
  font-size: 16px;
  font-weight: bold;
  margin: 24px 12px;
  padding-bottom: 24px;
`;

const SectionWrapper = styled.div`
  background-color: #eaeeef;
`;

const FilterWrapper = styled.div`
  display: flex;
  flex-direction: row;
`;

const FilterButton = styled.button`
  background-color: #00e0c2;
  border-radius: 8px;
  color: white;
  margin: 24px 8px;
  padding: 24px;
`;

export{
  ToggleBar,
  ToggleItem,
  SectionWrapper,
  FilterWrapper,
  FilterButton
};
